export const getPlaces = async (Token) => {
  try {
    const res = await axios({
      method: "get",
      url: `${url}api/places`,
      headers: { Authorization: `Bearer ${Token}` },
    });
    return res;
  } catch (error) {
    console.log(error);
  }
};

export const deletePlaces = async (Token, ids) => {
  try {
    const res = await axios({
      method: "delete",
      url: `${url}api/places/${ids}`,
      // url: `${url}boards/7`,
      headers: { Authorization: `Bearer ${Token}` },
    });
    return res;
  } catch (error) {
    console.log(error);
  }
};
